import classes from "./PostItem.module.css";

const PostItem = (props) => {
  const posts = [{ ...props.object }];
  console.log(posts);
  return (
    <div>
      {posts.forEach((element) => {
        <div key={element.id} className={classes["post-container"]}>
          <p>{element.title}</p>
          <h1 className={classes.heading}>{element.title}</h1>
          <p>{element.description}</p>
          <div className={classes.info}>
            <h4>Written by: {element.user}</h4>
          </div>
        </div>;
      })}
    </div>
  );
};

export default PostItem;
